import React from "react";

class RegistrationStep3 extends React.Component{
    constructor(props){
        super(props);

    }

    render(){
        return(
            <>
              <div className="step3-header-title">
                <h1 className="header-title" style={{ 
                    marginRight: "20px"
                 }}>Fill up your</h1>
                <h1 className="header-title-yellow"> Information</h1>
              </div>

              <div className="form-info">
                <label className="custom-label">First Name</label>
                <input className="custom-input" type="text" value="" defaultValue="" placeholder="first name" />
                
                <label className="custom-label">Middle Name</label>
                <input className="custom-input" type="text" value="" defaultValue="" placeholder="middle name" />
                
                <label className="custom-label">Last Name</label>
                <input className="custom-input" type="text" value="" defaultValue="" placeholder="last name" />
                
                <label className="custom-label">Birthdate</label>
                <input className="custom-input" type="date" value="" defaultValue="" placeholder="birthday" />
                
                <label className="custom-label">Address</label>
                <textarea className="custom-textarea"name="" id="" cols="30" rows="3"></textarea>
                
                <label className="custom-label">Email</label>
                <input className="custom-input" type="email" value="" defaultValue="" placeholder="eamil" />
              </div>
            </>
        )
    }
}

export default RegistrationStep3;
